import './App.css';
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './pages/Home';
import Recipes from './pages/Recipes';

function App() {
  return (
    <Router>
      <div className="app">
        <header>
          {/* Include your site header or navigation component here */}
        </header>
        <main>
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/Recipes" element={<Recipes />} />
          </Routes>
        </main>
        <footer>
          {/* Include your site footer component here */}
        </footer>
      </div>
    </Router>
  );
}

export default App;
